import React from 'react';
import {
  View,
  StyleSheet
} from 'react-native';
import ScreenTemplate from "./screenTemplate";

export default function Services() {
  return(
    <ScreenTemplate>

    </ScreenTemplate>
  )
}

const style = StyleSheet.create({
  background: {
    backgroundColor: 'blue',
  },
});
